import React from "react";
import "./MainPage.css";
import Title from "./TechLogo";
function MainPage()
{
    return(
        <div id="content-wrapper">
            <div id="titles">
                
                    <Title
                        fontSize="150px"
                        fontWeight="lighter"
                        color="#666666"
                        text="#TECH"
                        marginTop="0px"
                        display="inline-block"
                    />
                    <Title
                        fontSize="70px"
                        fontWeight="lighter"
                        color="#b2b2b2"
                        text="New thinking. New #tech."
                        display="inline-block"
                        marginTop="0px"
                    />
                
            </div>
            
        </div>
    );
}

export default MainPage;
